('node', 'forum', 0, 19, 19, 'und', 0, '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><h3>ATTENTION</h3>\r\n<p><strong>This page does not yet reflect new changes to Drush that apparently make Composer a prerequisite to Drush installation in the newer branches. I don''t have time to explore this right now. If you have the knowledge, please update this page to reflect that, then remove this message. In the meantime, users of this page can still install older versions of Drush using this method.</strong></p>\r\n<p><strong>Some instructions on installing Composer can be found in the <a href="#comment-8798219" rel="nofollow">comments</a></strong>.</p>\r\n<ol><li>If you don''t already have shell access, request access to SSH for your shared hosting account (e.g. for Hostmonster or Green Geeks: open a new support ticket with Tech Support (<strong>UPDATE:</strong> Shell access can now be enabled from cPanel for some hostmonster hosting accounts). For other Hosting services you may need to upgrade to use SSH.)</li>\r\n<li><a name="2" rel="nofollow" id="2"></a>Once you have received SSH access to your site, open a new Terminal and login to your site by typing the following <code>ssh username@yourdomain.com</code> or any additional user login string provided by your Hosting service</li>\r\n<li>Enter your password when prompted</li>\r\n<li>By default, you should be in your home directory (~). If you are not in your home directory, navigate yourself there by using the <code>cd ~</code> (cd = change directory command). The <code>''~''</code> is an alias for your home directory. On Hostmonster--and nearly every other Linux shared hosting situation--your website directory is located at <strong>~/public_html</strong>, or more specifically <strong>/www/htdocs/username</strong>.</li>\r\n<li>Confirm you are in your home directory by typing the bash shell command <code>ls</code>, which will list the files and folders in the current directory. On Hostmonster, you should see <code>public_html/</code>, <code>public_ftp</code>, and a bunch of other files. Make special note of a file named <code>.bashrc</code>, as we will be editing it later.</li>\r\n<li>Download Drush by typing <code>wget https://github.com/drush-ops/drush/archive/6.x.zip</code> (At the time of this edit, the Drush 6 branch is the recommended version and is no longer available for download on drupal.org). Extract the .zip file by typing in <code>unzip 6.x</code> and remove zip file by typing <code>rm 6.x.zip.</code><br>\r\n*Tip: type <code>clear</code> and hit enter. This will clear your screen, and give you a little more breathing room. Do this as much as you want to throughout this process<br><strong>**Important:</strong> If your host''s configuration does not allow for the <code>wget</code> command, you may alternately download the zip file of the recommended branch (currently <a href="https://github.com/drush-ops/drush/tree/6.x">https://github.com/drush-ops/drush/tree/6.x</a>) and manually upload and extract via the host''s cPanel File Manager, or an ftp program of your choice.</li>\r\n<li>Type <code>ls</code> again, to list your directory. You should now see <code>drush/</code> in the directory (if the directory is drush-6.x, rename to drush with <a href="http://unixhelp.ed.ac.uk/tasks/mv2.html" title="mv command help" rel="nofollow"><code>mv</code> command</a>).</li>\r\n<li>Type <code>chmod u+x drush</code> to set the correct permissions on the drush command.<br>\r\n*Tip: Type <code>ls -la</code> to see the permissions and owners on the items in the directory.</li>\r\n<li>Next, in order to use Drush across our installation&amp;emdash;in all of our sub-folders&amp;emdash;we need to add a line to our <code>.bashrc</code> file. While still in your home directory, type the following: <code>nano .bashrc</code>. This will open up <code>.bashrc</code> in a text editor named <code>nano</code>.<br>\r\n*note:  For GoDaddy accounts there is no nano application  (for new cPanel accounts nano is available). Use VIM instead. So type <code>vim .bashrc</code> to edit the file. A good VIM cheatsheet is: <a href="http://www.fprintf.net/vimCheatSheet.html" rel="nofollow">http://www.fprintf.net/vimCheatSheet.html</a>]<br>\r\nLocate <code># User specific aliases and functions</code>. Underneath that, add the following: <code>alias drush="~/drush/drush"</code>. Save the file by typing <code>ctrl+X</code> (Exit) and type <code>y</code> to accept your changes.</li>\r\n<li>Type <code>source ~/.bashrc</code> to refresh the alias list and allow the new drush commands to work.</li>\r\n<li>Confirm that Drush is working by typing <code>drush</code> at the command prompt and hitting <code>enter</code>. You should see a list of drush commands. If you do, then <code>success!</code></li>\r\n<li>If the previous step doesn''t work, type <code>exit</code> to end your SSH session, then log back in (See <a href="#2" rel="nofollow">step 2</a>) to restart your session. This refreshes <code>.bashrc</code> and allows the new drush commands to work. Some hosting providers such as <strong>GoDaddy</strong> (legacy accounts) use <strong>php-cgi</strong> in the command line instead of <strong>php-cli</strong>. The former is not compatible with Drush and if this is your case you have to locate <strong>php-cli</strong> and then add the following lines to your ~/.bashrc or ~/.bash-profile file:<br><div class="codeblock"><code>export COLUMNS<br>alias drush=''/usr/local/php5/bin/php ~/drush/drush.php''<br>alias php=''/usr/local/php5/bin/php''</code></div>\r\n</li>\r\n<li>You have now added drush hot sauce to your shared host. Awesome!</li>\r\n</ol><p>Once again, this should work on <em>any</em> shared hosting Linux platforms that allow shell access. On Hostmonster or Green Geeks, you have to specifically ask them to turn it on. If you do not have a <code>.bashrc</code> file in your home directory, try making it by typing <code>touch .bashrc</code>. You can also try using a file named .profile, .bash_aliases or .bash_profile, depending on your server''s setup.</p>\r\n<h4>SSH config</h4>\r\n<p>Since you''ll be using the ssh login prompt a lot, you might consider creating a local alias for your login credentials. Follow this link for <a href="http://nerderati.com/2011/03/simplify-your-life-with-an-ssh-config-file/" rel="nofollow">detailed instructions</a>. Note that in a Drush site-alias configuration you would use the host name configured in this file as <code>remote-host</code> and no <code>remote-user</code>.</p>\r\n<h3>Editorial Comments</h3>\r\n<p>For all those who didn''t really understand the instructions and are just trying to follow it as it is written, here''s a bit of advice: <em>only</em> use Drush if you start to understand it, even a little bit. Shell commands and Drush commands are very powerful and not recommended for learning on production sites or sites with a live server deadline, because you can mess things up very quickly. Your Shared Hosting support won''t be happy if you create code loops through failure. </p>\r\n<p><strong>Another bit of advice: If you are not a full-time developer, you should always use the stable non-beta releases of Drush, and should never use the additional -y command to avoid the security question "are you sure you want ... ? y/n.</strong></p>\r\n<p>To put it another way: Read the instructions twice, understand what the commands mean and what they do, don''t rely solely on copy/paste. In the long run, you will save your self time--which is the whole point of Drush in the first place.</p>\r\n<p>Let''s take the <em>alias</em> command as an example; you can exchange the <em>.bashrc alias</em> line with something else like  <em><strong><code>alias ddd=''~/drush/drush''</code></strong> </em>  instead of <em><strong><code>alias drush=''~/drush/drush''</code></strong></em>. This actually changes the way you use the Drush command later. Your commands will start with <em>ddd [your command]</em> then, instead of <em>drush [your command]</em>. And you can also add other aliases of course, like: <em> <strong><code>alias dddl=''~drush/drush en''</code></strong> </em>, which simplifies thee often-used Drush ''en'' command from <em><strong><code>drush dl</code></strong></em> to <em> <strong><code>dddl</code></strong></em>. In short, it is well worth your time (and safer) to go ahead and <em>learn</em> how to properly use Bash commands, if you plan on using Drush.</p>\r\n<p>The <a href="http://www.drush.ws" title="Drush" rel="nofollow">Drush Documentation</a> is a great place to start. It will teach you about Drush commands, and how to use them.</p>\r\n</div></div></div>', '', 'filtered_html'),
('node', 'forum', 0, 20, 20, 'und', 0, '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p>Note: this page should not be edited without first discussing the changes in a <a href="/node/add/project-issue/drupal">Drupal Core issue</a> as the requirements for each version of Drupal are decided upon by the Drupal Core developers.</p>\r\n<p>To install and run Drupal your web server must meet certain minimum requirements. Most web hosting companies meet these requirements. However, a few stand out by also actively supporting the Drupal community. If you need hosting, consider selecting one of <a href="http://drupal.org/hosting">these web hosts</a>.</p>\r\n<h2>Disk space</h2>\r\n<p>A minimum installation requires 15 Megabytes. 60 MB is needed for a website with many contributed modules and themes installed. Keep in mind you need much more for the database, files uploaded by the users, media, backups and other files.</p>\r\n<h2>Web server</h2>\r\n<p>Apache, Nginx, or Microsoft IIS<br><a href="/requirements/webserver">More details about web server requirements.</a></p>\r\n<h2>Database</h2>\r\n<p>Drupal 6: MySQL 4.1 or higher, PostgreSQL 7.1,<br>\r\nDrupal 7: MySQL 5.0.15 or higher with PDO, PostgreSQL 8.3 or higher with PDO, SQLite 3.3.7 or higher<br>\r\nDrupal 8: MySQL 5.0.15/MariaDB/Percona/equivalent or higher with PDO and an InnoDB-compatible primary storage engine, PostgreSQL 8.3 or higher with PDO, SQLite 3.3.7 or higher </p>\r\n<p><a href="/project/sqlsrv">Microsoft SQL Server</a> and <a href="/project/oracle">Oracle</a> are supported by additional modules.<br><a href="/requirements/database">More details about database requirements.</a></p>\r\n<h2>PHP</h2>\r\n<p>Drupal 6: PHP 5.2.x only. Warning: support for PHP 4.x has been dropped. PHP 5.3 and later may produce errors or unexpected behaviour.<br>\r\nDrupal 7: PHP 5.2.5 or higher (5.3 recommended).<br>\r\nDrupal 8: PHP 5.4 or higher.<br><a href="/requirements/php">More details about PHP requirements,</a> including <a href="https://www.drupal.org/requirements/php#memory">PHP memory</a>.</p>\r\n<p>See also the <a href="http://drupal.org/node/627252">Site Performance section</a> of the Administration Guide and the <a href="/node/34022">webhosting troubleshooting FAQ</a>.</p>\r\n</div></div></div>', '', 'filtered_html');
INSERT INTO `field_revision_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'forum', 0, 21, 21, 'und', 0, '<div class="field-item even"><p>Drupal works on any <a href="http://en.wikipedia.org/wiki/Webserver" rel="nofollow">web server</a> with PHP support.</p>\r\n<h3>Apache (Recommended)</h3>\r\n<p><a href="http://httpd.apache.org/" rel="nofollow">Apache</a> is the most commonly used web server for Drupal. Drupal will work on Apache 2.x hosted on UNIX/Linux, OS X, or Windows. </p>\r\n<p>The majority of Drupal development and deployment is done on Apache, so there is more community experience and testing performed on Apache than on other web servers. Drupal 7 and 6 will likely work on Apache 1.3.</p>\r\n<p>You can use the Apache ''mod_rewrite'' extension to <a href="/getting-started/clean-urls" rel="nofollow">allow for clean URLs</a>.</p>\r\n<p>The Apache Virtualhost configuration must contain the directive <code>AllowOverride All</code> to allow Drupal''s .htaccess file to be used.</p>\r\n<h3>Nginx</h3>\r\n<p><a href="http://www.nginx.com/" rel="nofollow">Nginx</a> is a commonly used web server that focuses on high concurrency, performance and low memory usage.</p>\r\n<p>Drupal will work on Nginx legacy versions (0.7.x, 0.8.x, 1.0.x, 1.2.x), stable 1.4.x versions, and mainline 1.5.x versions hosted on UNIX/Linux, OS X, or Windows. Nginx is a popular alternative to Apache, so there is also significant community experience and testing performed on Nginx.</p>\r\n<p>For information on enabling clean URLs, see <a href="/node/976392" rel="nofollow">Clean URLs with NGINX</a>.</p>\r\n<h3>Hiawatha</h3>\r\n<p><a href="https://www.hiawatha-webserver.org/" rel="nofollow">Hiawatha</a> is a web server with a strong focus on security. It also aims at being easy to use and being lightweight. Research performed by independent researchers proves that Hiawatha offers a performance comparable to other web servers under <a href="http://www.saltwaterc.ro/wp-download/documents/PHP_web_serving_study.pdf" rel="nofollow">normal conditions</a>, but much better <a href="https://www.hiawatha-webserver.org/weblog/64" rel="nofollow">while under attack</a>.</p>\r\n<p>Hiawatha is fully compatible with Drupal. For information about the required URL rewriting rules to use Drupal with Hiawatha, read <a href="/node/2275833" rel="nofollow">Clean URLs with Hiawatha</a>.</p>\r\n<h3>Microsoft IIS</h3>\r\n<p><a href="http://www.microsoft.com/iis" rel="nofollow">Microsoft IIS</a> is a web server and set of feature extension modules for use with Microsoft Windows.</p>\r\n<p>Drupal core will work with IIS 5, IIS 6, or IIS 7 if PHP is configured correctly.</p>\r\n<p>To achieve clean URLs you may need to use a third party product. For IIS 7 you can use the Microsoft URL Rewrite Module or a third party solution.</p>\r\n<p>On IIS 7 Drupal requires <a href="http://technet.microsoft.com/en-us/windowsserver/dd262148.aspx" rel="nofollow">Windows 2008 Server SP2</a> or later for fastCGI  support.</p>\r\n</div>', '', 'filtered_html'),
('node', 'forum', 0, 22, 22, 'und', 0, '<div class="field-item even"><p><strong>Recommended: </strong><a href="http://www.mysql.com/" rel="nofollow">MySQL</a> (or an equivalent such as <a href="http://mariadb.org/" rel="nofollow">MariaDB</a> or <a href="http://www.percona.com/software/percona-server" rel="nofollow">Percona Server</a>)</p>\r\n<h3>MySQL</h3>\r\n<ul><li>Drupal 6 supports MySQL 4.1 or higher, but MySQL 5.0.15 or higher is recommended</li>\r\n<li>Drupal 7 supports MySQL 5.0.15 or higher (or MySQL 5.1.30 or higher), and requires the PDO database extension for PHP (see <a href="/requirements/pdo" rel="nofollow">What is PDO?</a>).</li>\r\n<li>Drupal 8 supports MySQL 5.0.15 or higher (or MySQL 5.1.30 or higher) with InnoDB as the primary storage engine, and requires the PDO database extension.</li>\r\n</ul><p>There are several drop-in replacements for MySQL. Drupal has been extensively tested with <a href="http://mariadb.org/" rel="nofollow">MariaDB</a>, and version 5.1.44 (or greater) is recommended. It is also likely that other drop-in replacements such as <a href="http://www.percona.com/software/percona-server" rel="nofollow">Percona Server</a> will work well with Drupal, but they may not have specifically undergone testing.</p>\r\n<p><strong>Notes</strong>\r\n</p>\r\n<ul><li>Drupal makes use of some features not available on some inexpensive hosting plans so please check that your host allows database accounts with the following rights:<br>\r\nSELECT, INSERT, UPDATE, DELETE, CREATE, DROP, INDEX, ALTER.<br>\r\nThese rights are sufficient to run Drupal 6 and 7</li>\r\n<li>Some contributed modules, and also Drupal core 5.x (but not Drupal core 6.x), additionally require the following rights:<br>\r\nCREATE TEMPORARY TABLES, LOCK TABLES.</li>\r\n<li>It may be necessary to set the system variable max_allowed_packet to at least 16M. Some inexpensive hosting plans set this value too low (the MySQL default is only 1M). In that case, you may need to choose a better hosting plan. A value of 1M may be sufficient for Drupal 5.</li>\r\n<li>Drupal 7 and earlier support MyISAM and InnoDB table types. Drupal 8 no longer supports MyISAM as the primary storage engine, so InnoDB table types are recommended. NDB tables (MySQL Cluster) are not supported.</li>\r\n<li>Note that if your web hosting account is set up with a graphic control panel such as Plesk or CPanel, it is very likely that you do not need to worry about installing a driver for MySQL -- it is probably already installed on your server. You might wish to simply create your database and proceed with installing Drupal, and then refer back to Drupal documentation for specific troubleshooting help if you run into problems.</li>\r\n</ul><h3>PostgreSQL</h3>\r\n<p>Note: Some contributed modules are not as abstracted from MySQL-specific code as everyone would like. If you are familiar with PostgreSQL please file issues with those contributed modules as you find them.</p>\r\n<ul><li>Drupal 6 supports PostgreSQL 7.1 or higher</li>\r\n<li>Drupal 7 supports PostgreSQL 8.3 or higher</li>\r\n</ul><h3>SQLite</h3>\r\n<p>SQLite 3.3.7 or higher  - Drupal 7 only.</p>\r\n<p>Note: Some contributed modules are not as abstracted from MySQL-specific code as everyone would like. If you are familiar with SQLite please file issues with those contributed modules as you find them.</p>\r\n<h3>Other database servers</h3>\r\n<p><a href="http://drupal.org/project/sqlsrv" rel="nofollow">Microsoft SQL Server</a>, <a href="http://drupal.org/project/oracle" rel="nofollow">Oracle</a>, and <a href="https://drupal.org/project/mongodb" rel="nofollow">MongoDB</a> are supported by additional modules.</p>\r\n<p>Please see discussions in the <a href="http://groups.drupal.org/enterprise" rel="nofollow">Enterprise Group</a> if you are interested in working on database support.</p>\r\n</div>', '', 'filtered_html'),
('node', 'page', 0, 23, 23, 'und', 0, '<div class="shortcode-section">\r\n<h1 class="page-header">Quote</h1>\r\n<h3>Example</h3>\r\n[quote class="my-quote"]This is my quote[/quote]\r\n<h3>Shortcode</h3>\r\n<pre><code>&#91;quote class=&quot;my-quote&quot;]This is my quote&#91;/quote]</code></pre>\r\n</div>\r\n\r\n<div class="shortcode-section">\r\n<h1 class="page-header">Image</h1>\r\n<h3>Example</h3>\r\n[img src="sites/all/themes/forum_plus/logo.png" class="my-image" alt="logo image" /]\r\n<h3>Shortcode</h3>\r\n<pre><code>&#91;img src="sites/all/themes/forum_plus/logo.png" class="my-image" alt="logo image" /]</code></pre>\r\n</div>\r\n\r\n<div class="shortcode-section">\r\n<h1 class="page-header">Highlight</h1>\r\n<h3>Example</h3>\r\n[highlight class="my-highlight"]This is highlight text[/highlight]\r\n<h3>Shortcode</h3>\r\n<pre><code>&#91;highlight class="my-highlight"]This is highlight text&#91;/highlight]</code></pre>\r\n</div>\r\n\r\n<div class="shortcode-section">\r\n<h1 class="page-header">Button</h1>\r\n<h3>Example</h3>\r\n[button path="#" class="my-button"]This is my button[/button]\r\n<h3>Shortcode</h3>\r\n<pre><code>&#91;button path="#" class="my-button"]This is my button&#91;/button]</code></pre>\r\n</div>\r\n\r\n<div class="shortcode-section">\r\n<h1 class="page-header">Dropcap</h1>\r\n<h3>Example</h3>\r\n[dropcap class="my-dropcap"]This is dropcap[/dropcap]\r\n<h3>Shortcode</h3>\r\n<pre><code>&#91;dropcap class="my-dropcap"]This is dropcap&#91;/dropcap]</code></pre>\r\n</div>\r\n\r\n<div class="shortcode-section">\r\n<h1 class="page-header">Item</h1>\r\n<h3>Example</h3>\r\n[item class="my-item" type="span"]This is an item[/item]\r\n<h3>Shortcode</h3>\r\n<pre><code>&#91;item class="my-item" type="span"]This is an item&#91;/item]</code></pre>\r\n</div>\r\n', '', 'full_html'),
