(16, 'node', ' headline news general discussion drupal 6 extended support announcement on february 13 2008 drupal 6 was released the policy of the community is to support only the current and previous stable versions when drupal 6 was released drupal 47x was marked unsupported when drupal 7 came out drupal 5x was marked unsupported this policy was created to prevent core and module maintainers from having to maintain more than 2 active major versions of drupal with the coming drupal 8 release this policy has been questioned we want to ensure that sites that wish to move from drupal 6 to drupal 8 have a supported window within which to do so the drupal core team key module maintainers and representatives of the drupal security team met at drupalcon austin to discuss this as an inperson follow up to the previous discussion at https drupalorg node 2136029  drupal 6 core and modules will transition to unsupported status three months after drupal 8 is released unsupported status means the community will not be providing support or patches in the same way we do now continuing to support drupal 6 would be difficult for many reasons including a lack of automated test coverage the requirement for rigorous manual release testing the slowdown it introduces in the release of security fixes for the vast majority of drupal users on version 7 and the general shift of volunteers in the community moving their attention onto drupal 8 development this gives drupal 6 users a few options 1 upgrade to drupal 7 any time between now and 3 months after drupal 800 is released drupal 7 releases undergo almost 40000 automated tests and drupal 7 will be fully supported at least until drupal 9 comes out given the past history the release of drupal 9 is likely to be around 2018 2 upgrade to drupal 8 after it is released but before drupal 6 is not supported anymore fortunately migrate support for drupal 6 to drupal 8 is already in core and there is migrate ui a contributed module while not all contributed modules will be ready at the time drupal 8 is released drupal 8 s migration path handles most of the critical site data via its cck to entities fields in core migrations 3 find an organization that will provide extended support for drupal 6 the drupal security team will provide a method for companies and or individuals to work together in the private security issue queue to continue developing updates and will provide a reasonable amount of time for companies to provide patches to drupal 6 security issues that also affect drupal 7 or drupal 8 the security team will coordinate access to issues for companies wishing to provide extended support for drupal 6 however the team will not explicitly review or test the patches some team members may do this on their own all code created by these vendors would be released to the community organizations and individuals interested in providing this level of support for their customers and who have the technical knowledge to maintain a drupal core release should go to the security team drupal 6 long term support page both the security team and drupal core leadership feel that a 3month window after drupal 8 s release before eclipsing community support for drupal 6 is a workable compromise between leaving drupal 6 sites on an unsupported version the second drupal 8 comes out and acknowledging that our community s volunteer resources are limited and have shifted focus we hope that organizations that rely on drupal 6 will step up to help maintain it after community support winds down and or help their clients update to d8 select rating give it 15 give it 25 give it 35 give it 45 give it 55 your rating none average 45 2 votes  mon 7142014 5  7 admin online last seen 2 min 57 sec ago joined 6122014 1540 drupal 728 released drupal 728 a maintenance release with numerous bug fixes no security fixes is now available for download see the drupal 728 release notes for a full listing download drupal 728 upgrading your existing drupal 7 sites is recommended there are no major new features in this release for more information about the drupal 7x release series consult the drupal 70 release announcement security information we have a security announcement mailing list and a history of all security advisories as well as an rss feed with the most recent security advisories we strongly advise drupal administrators to sign up for the list drupal 7 includes the builtin update manager module which informs you about important updates to your modules and themes there are no security fixes in this release of drupal core bug reports drupal 7x is being maintained so given enough bug fixes not just bug reports more maintenance releases will be made available according to our monthly release cycle changelog drupal 728 contains bug fixes and small api feature improvements only the full list of changes between the 727 and 728 releases can be found by reading the 728 release notes a complete list of all bug fixes in the stable 7x branch can be found in the git commit log update notes see the 728 release notes for details on important changes in this release known issues changes made to the update manager module in this release may lead to performance slowdowns in certain cases including on rare page loads for site visitors if the site is using the automated cron feature see the release notes for more information select rating give it 15 give it 25 give it 35 give it 45 give it 55 your rating none average 4 2 votes  drupal themes web development top log in or register to post comments  ', 0),
