(19, 'node', ' installing drush on shared hosting accounts paid drupal services attention this page does not yet reflect new changes to drush that apparently make composer a prerequisite to drush installation in the newer branches i don t have time to explore this right now if you have the knowledge please update this page to reflect that then remove this message in the meantime users of this page can still install older versions of drush using this method some instructions on installing composer can be found in the comments  if you don t already have shell access request access to ssh for your shared hosting account eg for hostmonster or green geeks open a new support ticket with tech support  update  shell access can now be enabled from cpanel for some hostmonster hosting accounts for other hosting services you may need to upgrade to use ssh  once you have received ssh access to your site open a new terminal and login to your site by typing the following ssh username yourdomaincom or any additional user login string provided by your hosting service enter your password when prompted by default you should be in your home directory if you are not in your home directory navigate yourself there by using the cd cd change directory command the is an alias for your home directory on hostmonster and nearly every other linux shared hosting situation your website directory is located at  publichtml  or more specifically  www htdocs username  confirm you are in your home directory by typing the bash shell command ls which will list the files and folders in the current directory on hostmonster you should see publichtml publicftp and a bunch of other files make special note of a file named bashrc as we will be editing it later download drush by typing wget https githubcom drushops drush archive 6xzip at the time of this edit the drush 6 branch is the recommended version and is no longer available for download on drupalorg extract the zip file by typing in unzip 6x and remove zip file by typing rm 6xzip tip type clear and hit enter this will clear your screen and give you a little more breathing room do this as much as you want to throughout this process  important  if your host s configuration does not allow for the wget command you may alternately download the zip file of the recommended branch currently https githubcom drushops drush tree 6x  and manually upload and extract via the host s cpanel file manager or an ftp program of your choice type ls again to list your directory you should now see drush in the directory if the directory is drush6x rename to drush with mv command  type chmod u x drush to set the correct permissions on the drush command tip type ls la to see the permissions and owners on the items in the directory next in order to use drush across our installation emdash in all of our subfolders emdash we need to add a line to our bashrc file while still in your home directory type the following nano bashrc this will open up bashrc in a text editor named nano note for godaddy accounts there is no nano application for new cpanel accounts nano is available use vim instead so type vim bashrc to edit the file a good vim cheatsheet is  http wwwfprintfnet vimcheatsheethtml  locate user specific aliases and functions underneath that add the following alias drush drush drush save the file by typing ctrl x exit and type y to accept your changes type source bashrc to refresh the alias list and allow the new drush commands to work confirm that drush is working by typing drush at the command prompt and hitting enter you should see a list of drush commands if you do then success if the previous step doesn t work type exit to end your ssh session then log back in see step 2  to restart your session this refreshes bashrc and allows the new drush commands to work some hosting providers such as godaddy  legacy accounts use phpcgi in the command line instead of phpcli  the former is not compatible with drush and if this is your case you have to locate phpcli and then add the following lines to your bashrc or bashprofile file export columnsalias drush usr local php5 bin php drush drushphp alias php usr local php5 bin php you have now added drush hot sauce to your shared host awesome once again this should work on any shared hosting linux platforms that allow shell access on hostmonster or green geeks you have to specifically ask them to turn it on if you do not have a bashrc file in your home directory try making it by typing touch bashrc you can also try using a file named profile bashaliases or bashprofile depending on your server s setup ssh config since you ll be using the ssh login prompt a lot you might consider creating a local alias for your login credentials follow this link for detailed instructions  note that in a drush sitealias configuration you would use the host name configured in this file as remotehost and no remoteuser  editorial comments for all those who didn t really understand the instructions and are just trying to follow it as it is written here s a bit of advice  only use drush if you start to understand it even a little bit shell commands and drush commands are very powerful and not recommended for learning on production sites or sites with a live server deadline because you can mess things up very quickly your shared hosting support won t be happy if you create code loops through failure another bit of advice if you are not a fulltime developer you should always use the stable nonbeta releases of drush and should never use the additional y command to avoid the security question are you sure you want y n to put it another way read the instructions twice understand what the commands mean and what they do don t rely solely on copy paste in the long run you will save your self time which is the whole point of drush in the first place let s take the alias command as an example you can exchange the bashrc alias line with something else like alias ddd drush drush  instead of alias drush drush drush   this actually changes the way you use the drush command later your commands will start with ddd your command  then instead of drush your command   and you can also add other aliases of course like  alias dddl drush drush en   which simplifies thee oftenused drush en command from drush dl to dddl  in short it is well worth your time and safer to go ahead and learn how to properly use bash commands if you plan on using drush the drush documentation is a great place to start it will teach you about drush commands and how to use them select rating give it 15 give it 25 give it 35 give it 45 give it 55 no votes yet  ', 0),
(20, 'node', ' system requirements before you start note this page should not be edited without first discussing the changes in a drupal core issue as the requirements for each version of drupal are decided upon by the drupal core developers to install and run drupal your web server must meet certain minimum requirements most web hosting companies meet these requirements however a few stand out by also actively supporting the drupal community if you need hosting consider selecting one of these web hosts  disk space a minimum installation requires 15 megabytes 60 mb is needed for a website with many contributed modules and themes installed keep in mind you need much more for the database files uploaded by the users media backups and other files web server apache nginx or microsoft iis more details about web server requirements database drupal 6 mysql 41 or higher postgresql 71 drupal 7 mysql 5015 or higher with pdo postgresql 83 or higher with pdo sqlite 337 or higher drupal 8 mysql 5015 mariadb percona equivalent or higher with pdo and an innodbcompatible primary storage engine postgresql 83 or higher with pdo sqlite 337 or higher microsoft sql server and oracle are supported by additional modules more details about database requirements php drupal 6 php 52x only warning support for php 4x has been dropped php 53 and later may produce errors or unexpected behaviour drupal 7 php 525 or higher 53 recommended drupal 8 php 54 or higher more details about php requirements  including php memory  see also the site performance section of the administration guide and the webhosting troubleshooting faq  select rating give it 15 give it 25 give it 35 give it 45 give it 55 no votes yet  ', 0),
(21, 'node', ' web server before you start drupal works on any web server with php support apache recommended  apache is the most commonly used web server for drupal drupal will work on apache 2x hosted on unix linux os x or windows the majority of drupal development and deployment is done on apache so there is more community experience and testing performed on apache than on other web servers drupal 7 and 6 will likely work on apache 13 you can use the apache modrewrite extension to allow for clean urls  the apache virtualhost configuration must contain the directive allowoverride all to allow drupal s htaccess file to be used nginx nginx is a commonly used web server that focuses on high concurrency performance and low memory usage drupal will work on nginx legacy versions 07x 08x 10x 12x stable 14x versions and mainline 15x versions hosted on unix linux os x or windows nginx is a popular alternative to apache so there is also significant community experience and testing performed on nginx for information on enabling clean urls see clean urls with nginx  hiawatha hiawatha is a web server with a strong focus on security it also aims at being easy to use and being lightweight research performed by independent researchers proves that hiawatha offers a performance comparable to other web servers under normal conditions  but much better while under attack  hiawatha is fully compatible with drupal for information about the required url rewriting rules to use drupal with hiawatha read clean urls with hiawatha  microsoft iis microsoft iis is a web server and set of feature extension modules for use with microsoft windows drupal core will work with iis 5 iis 6 or iis 7 if php is configured correctly to achieve clean urls you may need to use a third party product for iis 7 you can use the microsoft url rewrite module or a third party solution on iis 7 drupal requires windows 2008 server sp2 or later for fastcgi support select rating give it 15 give it 25 give it 35 give it 45 give it 55 no votes yet  ', 0),
(22, 'node', ' database server before you start recommended  mysql  or an equivalent such as mariadb or percona server   mysql drupal 6 supports mysql 41 or higher but mysql 5015 or higher is recommended drupal 7 supports mysql 5015 or higher or mysql 5130 or higher and requires the pdo database extension for php see what is pdo   drupal 8 supports mysql 5015 or higher or mysql 5130 or higher with innodb as the primary storage engine and requires the pdo database extension there are several dropin replacements for mysql drupal has been extensively tested with mariadb  and version 5144 or greater is recommended it is also likely that other dropin replacements such as percona server will work well with drupal but they may not have specifically undergone testing notes drupal makes use of some features not available on some inexpensive hosting plans so please check that your host allows database accounts with the following rights select insert update delete create drop index alter these rights are sufficient to run drupal 6 and 7 some contributed modules and also drupal core 5x but not drupal core 6x additionally require the following rights create temporary tables lock tables it may be necessary to set the system variable maxallowedpacket to at least 16m some inexpensive hosting plans set this value too low the mysql default is only 1m in that case you may need to choose a better hosting plan a value of 1m may be sufficient for drupal 5 drupal 7 and earlier support myisam and innodb table types drupal 8 no longer supports myisam as the primary storage engine so innodb table types are recommended ndb tables mysql cluster are not supported note that if your web hosting account is set up with a graphic control panel such as plesk or cpanel it is very likely that you do not need to worry about installing a driver for mysql it is probably already installed on your server you might wish to simply create your database and proceed with installing drupal and then refer back to drupal documentation for specific troubleshooting help if you run into problems postgresql note some contributed modules are not as abstracted from mysqlspecific code as everyone would like if you are familiar with postgresql please file issues with those contributed modules as you find them drupal 6 supports postgresql 71 or higher drupal 7 supports postgresql 83 or higher sqlite sqlite 337 or higher drupal 7 only note some contributed modules are not as abstracted from mysqlspecific code as everyone would like if you are familiar with sqlite please file issues with those contributed modules as you find them other database servers microsoft sql server   oracle  and mongodb are supported by additional modules please see discussions in the enterprise group if you are interested in working on database support select rating give it 15 give it 25 give it 35 give it 45 give it 55 no votes yet  ', 0),
