INSERT INTO `token_custom` (`machine_name`, `name`, `description`, `type`, `content`, `format`) VALUES
('comment-text-teaser', 'comment-text-teaser', 'comment text teaser', 'comment', '<?php\r\n$entity_type = ''comment'';\r\n$entity = $data[''comment''];\r\n$wrapper = entity_metadata_wrapper($entity_type, $entity);\r\n\r\n  // Select the right field acoring to the entity type.\r\n  $field_name = $entity_type == ''node'' ? ''body'' : ''comment_body'';\r\n  $field_value = $wrapper->{$field_name}->value();\r\n\r\n  if (!$field_value) {\r\n    return;\r\n  }\r\n\r\n  // Get the safe value.\r\n  $field_value = $wrapper->{$field_name}->value->value();\r\n\r\n  $options = array(\r\n    ''max_length'' => 50,\r\n    ''html'' => true,\r\n  );\r\n  $trim_text = views_trim_text($options, $field_value);\r\n  $trim_text = strip_tags($trim_text);\r\n\r\n  // Checking if we need to add the "Read more" link.\r\n  if ($field_value != $trim_text) {\r\n    $uri = entity_uri($entity_type, $entity);\r\n    // Add a "Read more" before the closing <p>.\r\n    $trim_text .= ''... '' . l(t(''Read more''), $uri[''path''], $uri[''options'']);\r\n  }\r\n\r\n  return $trim_text;\r\n?>', 'php_code');
